import React,{useState} from "react";
import axios from "axios";


function AddPackage(){

  const [name,setName] = useState("");
  const [pid,setPid] = useState("");
  const [Destination,setDesti] = useState("");

  function sendData(e){
   e.preventDefault();
   
   const newPackage={

     name,
     pid,
     Destination


   }

   console.log(newPackage);

  }

 return(

   <div className="container">
    <form onSubmit={sendData}>
    
    <div className="form-group">
      <label for="Name">Package Name</label>
      <input type="text" class="form-control" id="pacName" placeholder="Enter Package Name here"
      onChange={(e)=> {

        setName(e.target.value);

       } }/>
  
    </div>
    
    <div className="form-group">
      <label for="id">Package ID</label>
      <input type="text" class="form-control" id="packId" placeholder="Enter Package ID here"
       onChange={(e)=> {

        setPid(e.target.value);

       } }/>
      
      
  
    </div>
  
    <div className="form-group">
      <label for="desti">Destination</label>
      <input type="text" class="form-control" id="desti" placeholder="Enter Your Destination here"
      onChange={(e)=> {

        setDesti(e.target.value);

       } }/>
      
  
    </div>
   
    <button type="submit" class="btn btn-primary">Submit</button>
   </form>
   </div>




 )




}

export default AddPackage;
